import { createSlice } from '@reduxjs/toolkit'

const initialState = {
    Room:[]
}

export const UserSlice = createSlice({
  name: 'bookedRoom',
  initialState,
  reducers: {
    bookedRoom: (state,action) => {
      state.Room.concat(action.payload)
    }
  },
})

// Action creators are generated for each case reducer function
export const {bookedRoom} = bookedRoom.actions

export default bookedRoom.reducer
